import React from "react";
import "./App.css";

import Essentials from "./context/Essentials";
import ProjectsContext from "./context/ProjectsContext";
// COMPONENTS
import Components from "./components";

// FUNCTIONS
function App() {
  return (
    <div>
      <Essentials>

      <ProjectsContext>
        <Components />
      </ProjectsContext>
      </Essentials>
    </div>
  );
}

export default App;
